import React, { useEffect, useState } from 'react';
import logo from './logo.svg';
import './App.css';

function App() {
  const [message, setMessage] = useState('');

  useEffect(() => {//Fetch data from flaskbackend
    fetch('http://127.0.0.1:5000/') //Port flask is on
      .then((response) => response.text()) //message from Flask
      .then((data) => setMessage(data))//capture message from flask
      .catch((error) => console.log('Error fetching data:', error));
  }, []);

  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <h1>Tea Talks</h1>
        <navbar>
          <ul>
            <li>Settings</li>
            <li>User Profile</li>
          </ul>
        </navbar>
        <p>{message || 'Loading message from Flask...'}</p> {/*flask message*/}
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
    </div>
  );
}

export default App;
